/* Idea: Given up a diagram, we'll generate, systematically, all the
   renumberings which should result in isomorphic diagrams: we should 
   be able to then see if pd_diagram_isotopic picks them up. */

bool all_diagram_isotopies_test(pd_code_t *pd,char *name)
{

  printf("all diagram isotopies test for pd code %s\n",name);
  printf("a %d-crossing, %d-component pd code.\n",pd->ncross,pd->ncomps);
  printf("--------------------------------------------\n");

  printf("testing pd_ok...");

  if (!pd_ok(pd)) { 

    pd_printf("fail (pd %PD does not pass pd_ok)\n",pd);
    return false;

  }

  printf("pass (pd_ok).\n");

  printf("constructing multidx for iteration...");

  pd_idx_t **compsizes;
  pd_idx_t i;

  compsizes = calloc(pd->ncomps,sizeof(pd_idx_t *));
  assert(compsizes != NULL);
  for(i=0;i<pd->ncomps;i++) { compsizes[i] = &(pd->comp[i].nedges); }

  pd_multidx_t *idx = pd_new_multidx(pd->ncomps,(void **)(compsizes),cyclic_ops);

  printf("pass (%d possible variations of this pd_code)\n",pd_multidx_nvals(idx));

  for(i=0;i<pd_multidx_nvals(idx);i++,pd_increment_multidx(idx)) { 

    pd_code_t *pdCopy = pd_copy(pd);
    pd_idx_t j;

    for(j=0;j<pd->ncomps;j++) { 

      pd_cyclic_t *d = (pd_cyclic_t *)(idx->obj[j]);
      pd_renumber_component(pdCopy,j,d->map[0]);

    }

    if (!pd_diagram_isotopic(pd,pdCopy)) {

      pd_printf("fail at %MULTIDX\n",pd,idx);
      
      for(j=0;j<pd->ncomps;j++) { 

	pd_printf("\t %CYCLIC \n",pd,(pd_cyclic_t *)(idx->obj[j]));

      }

      pd_printf("renumbered and reoriented pd \n"
		"-----------------------------\n"
		"%PD\n",pdCopy);
      pd_printf("-----------------------------\n"
		"is not diagram-isotopic to original pd\n"
		"-----------------------------\n"
		"%PD\n",pd);
      printf("-----------------------------\n");

      return false;

    }

    pd_code_free(&pdCopy);

  }

  pd_free_multidx(&idx); 
  printf("pass (%d of %d reorder/renumberings detected as diagram-isotopic)\n",i,i);

  return true;
}

